def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None:
        if isinstance(group_axis, MultiIndex):
            # handle MultiIndex
            if is_list_like(level) and len(level) == 1:
                level = level[0]

            if key is None and is_scalar(level):
                # Get the level values from group_axis
                key = group_axis.get_level_values(level)
                level = None

    keys = []
    if key is not None:
        if isinstance(key, (list, tuple)):
            keys = key
        else:
            keys = [key]

    groupings = []
    exclusions = set()

    for i, gpr in enumerate(keys):

        if not isinstance(gpr, (str, int)):
            raise KeyError(gpr)

        if gpr not in obj:
            raise KeyError(f"Column '{gpr}' doesn't exist in the DataFrame")

        # create the Grouping
        ping = (
            Grouping(
                group_axis,
                gpr,
                obj=obj,
                in_axis=True,
                sort=sort,
                observed=observed,
            )
        )
        groupings.append(ping)
        exclusions.add(gpr)

    if len(groupings) == 0:
        raise ValueError("No group keys passed!")

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, list(exclusions), obj
